// ==UserScript==
// @name         Add to Sonarr/Radarr for IMDb and Letterboxd
// @namespace    https://www.imdb.com/
// @version      1.8
// @description  Adds buttons to IMDb and Letterboxd to search for a show/movie in Sonarr/Radarr
// @author       xdpirate
// @license      GPLv3
// @match        https://www.imdb.com/title/*
// @match        https://letterboxd.com/film/*
// @icon         https://www.google.com/s2/favicons?sz=64&domain=sonarr.tv
// @grant        GM_getValue
// @grant        GM_setValue
// @downloadURL https://update.greasyfork.org/scripts/467340/Add%20to%20SonarrRadarr%20for%20IMDb%20and%20Letterboxd.user.js
// @updateURL https://update.greasyfork.org/scripts/467340/Add%20to%20SonarrRadarr%20for%20IMDb%20and%20Letterboxd.meta.js
// ==/UserScript==
let radarrURL = GM_getValue("radarrURL", "http://localhost:7878");
let sonarrURL = GM_getValue("sonarrURL", "http://localhost:8989");

let imdbID, referenceNode, titleName;

let site = window.location.hostname.includes("imdb.com") ? "imdb" : "lb";

if(site == "imdb") {
    let pagePath = window.location.pathname.split("/");

    // Iterate in reverse since ID appears at end of URL
    for(let i = pagePath.length - 1; i >= 0; i--) {
        if(pagePath[i].startsWith("tt")) {
            imdbID = pagePath[i];
            break;
        }
    }

    referenceNode = document.querySelector("section.ipc-page-section > div > div > h1");
    titleName = referenceNode.querySelector("span").innerText.trim();
} else if(site == "lb") {
    let urlPath = document.querySelector("a.micro-button[href^='http://www.imdb.com/title/']").href.split("/");
    imdbID = urlPath[urlPath.length - 2];
    referenceNode = document.querySelector("section.-film");
    titleName = referenceNode.querySelector("span.name").innerText.trim();
}

let buttons = `
    <div>
        <a href="${radarrURL}/add/new?term=imdb:${imdbID}" target="_blank"><img style="display: inline !important;" title="Search Radarr for ${titleName}" width="32" height="32" src="data:image/vnd.microsoft.icon;base64," /></a>
        ${site == "imdb" ? `<a href="${sonarrURL}/add/new?term=${encodeURIComponent(titleName)}" target="_blank"><img style="display: inline !important;" title="Search Sonarr for ${titleName}" width="32" height="32" src="data:image/vnd.microsoft.icon;base64," /></a>` : ''}
        <span id="ATSRSettingsButton" style="cursor: pointer;" title="Set instance URLs">âš™</span>
    </div>
`;

referenceNode.insertAdjacentHTML(site == "imdb" ? "afterend" : "beforeend", buttons);

document.getElementById("ATSRSettingsButton").addEventListener("click", function() {
    let rURL = prompt("Enter the URL to your Radarr instance:", radarrURL);

    if(rURL != null) {
        GM_setValue("radarrURL", rURL);
    }

    let sURL = prompt("Enter the URL to your Sonarr instance:", sonarrURL);

    if(sURL != null) {
        GM_setValue("sonarrURL", sURL);
    }

    if(rURL != null && sURL != null) {
        location.reload();
    }
});